p>\\n\\n\\t\\t</div>\\n\\t</div>\\n<div><a href=\"tel:02 4353 9924\" title=\"\"><i/> 02 4353 9924</a></div>\\n</div></div></div><div><div><div>\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t<h3>Erina</h3>\\n<p><span>4 Karalta Rd<br/>\\n<span mce-data-marked=\"1\">Erina</span></span></p>\\n\\n\\t\\t</div>\\n\\t</div>\\n<div><a href=\"tel:02 4367 2111\" title=\"\"><i/> 02 4367 2111</a></div>\\n</div></div></div><div><div><div>\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t<h3>Woy Woy</h3>\\n<p><span>56 Memorial Ave<br/>\\n<span mce-data-marked=\"1\">Blackwall</span></span></p>\\n\\n\\t\\t</div>\\n\\t</div>\\n<div><a href=\"tel:02 4341 3700\" title=\"\"><i/> 02 4341 3700</a></div>\\n</div></div></div><div><div><div>\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t<h3>Cessnock</h3>\\n<p><span>1/1 Charlton St<br/>\\n<span mce-data-marked=\"1\">Cessnock</span></span></p>\\n\\n\\t\\t</div>\\n\\t</div>\\n<div><a href=\"tel:02 4990 1532\" title=\"\"><i/> 02 4990 1532</a></div>\\n</div></div></div></div></div></div></div></div><div/></div><div><div><div><div><div>\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t<h1><span>The Central Coast Mechanics That Offer More</span></h1>\\n<p>&#160;</p>\\n<p>The first and only No Booking, Auto&#160;service centre. At Express Lube, all of our work is warranty approved and completed following strict manufacturers guidelines. We only use quality, brand name products and state of the art machinery. Your service will be completed by one of our highly trained, qualified technicians all in the time it takes to have a quick cup of coffee in our comfortable customer waiting lounge.</p>\\n<p>Try us once and we know you&#8217;ll use us forever!</p>\\n<p>At&#160;Express Lube we offer you more &#8212; more savings, more convenience and more time doing the things you enjoy. We know that it&#8217;s difficult finding the right date and time to book your car in. With busy schedules and last minute meetings, parties or appointments, booking weeks in advance is a hassle. We change all that by allowing you to come in whenever you&#8217;re free.&#160;With 5 convenient locations on the Central Coast, Erina, Tuggerah, West Gosford, Woy Woy, and now at our newest workshop in Cessnock, servicing your vehicle has never been easier.</p>\\n<p>All our technicians are highly skilled and make it their mission&#160;to provide a quality service at a great price. We are an experienced car servicing centre providing superior work in a fraction of the time other mechanics provide. If you have any questions regarding our service please contact your nearest location using the numbers above.</p>\\n\\n\\t\\t</div>\\n\\t</div>\\n<div><span/></div>\\n</div></div></div><div><div><div>\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t<p><img width=\"346\" height=\"513\" alt=\"Peter-flip\" src=\"//expresslube.com.au/wp-content/uploads/2017/02/peter-flip.jpg\"/></p>\\n\\n\\t\\t</div>\\n\\t</div>\\n</div></div></div></div></div><div><div data-vc-full-width=\"true\" data-vc-full-width-init=\"false\"><div><div><div><div><span/></div>\\n\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t<h2><span>What our customers say&#8230;</span></h2>\\n<p><span>No Booking Required, Friendly Service, Free Coffee, Free Wifi, whats not to love about Express Lube.</span></p>\\n\\n\\t\\t</div>\\n\\t</div>\\n</div></div></div><div><div><div>\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t\\n\\t\\t\\t<div><iframe width=\"960\" height=\"540\" src=\"https://www.youtube.com/embed/YOg3oRxxB4A?feature=oembed\" frameborder=\"0\" allowfullscreen=\"\"/></div>\\n\\t\\t</div>\\n\\t</div>\\n</div></div></div><div><div><div>\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t\\n\\t\\t\\t<div><iframe width=\"960\" height=\"540\" src=\"https://www.youtube.com/embed/YiaiL1WUsdA?feature=oembed\" frameborder=\"0\" allowfullscreen=\"\"/></div>\\n\\t\\t</div>\\n\\t</div>\\n</div></div></div></div><div/></div><div><div data-vc-full-width=\"true\" data-vc-full-width-init=\"false\"><div><div><div><div><div><div><div/></div></div></div><div><div><div><div><div>&#13;\\n                <h2><i/>Express Lube Recent Blogs</h2>&#13;\\n            </div></div></div></div></div>\\n<div>\\n\\t<div data-initial-loading-animation=\"fadeIn\" data-vc-grid-settings=\"{&quot;page_id&quot;:11,&quot;style&quot;:&quot;all&quot;,&quot;action&quot;:&quot;vc_get_vc_grid_data&quot;,&quot;shortcode_id&quot;:&quot;1544761866482-00847532-4c6d-5&quot;,&quot;tag&quot;:&quot;vc_basic_grid&quot;}\" data-vc-request=\"https://expresslube.com.au/wp-admin/admin-ajax.php\" data-vc-post-id=\"11\" data-vc-public-nonce=\"c8835f6c4e\">\\n\\t</div>\\n</div>\\n</div></div></div></div><div/></div><div><div data-vc-full-width=\"true\" data-vc-full-width-init=\"false\"><div><div><div><div>&#13;\\n                <h2><i/>Frequently Asked Questions</h2>&#13;\\n            </div><div data-vc-action=\"collapseAll\"><div><div><div><div id=\"1475552327013-2dfbce5f-5b76\" data-vc-content=\".vc_tta-panel-body\"><div><h4><a href=\"#1475552327013-2dfbce5f-5b76\" data-vc-accordion=\"\" data-vc-container=\".vc_tta-container\"><span>How often should I change my oil?</span><i/></a></h4></div><div>\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t<p><span>Regular oil should be changed every 10,000 km or 6 months. Some manufacturers have different service intervals so always refer to your owner&#8217;s manual for details.</span></p>\\n\\n\\t\\t</div>\\n\\t</div>\\n</div></div><div id=\"1475552327105-9a61dabb-a849\" data-vc-content=\".vc_tta-panel-body\"><div><h4><a href=\"#1475552327105-9a61dabb-a849\" data-vc-accordion=\"\" data-vc-container=\".vc_tta-container\"><span>What should the tyre pressure be on my car?</span><i/></a></h4></div><div>\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t<p>The tyre pressure should always be set to the tyre manufacturers suggest PSI (pounds per square inch) pressure. The correct pressure for your vehicle can be found in your owner&#8217;s manual or on the tyre sticker on the inside of the driver&#8217;s door <p/></p>\\n<p>Properly inflated tyres will give you better fuel consumption, tyre wear, and overall handling of your vehicle. <p/></p>\\n\\n\\t\\t</div>\\n\\t</div>\\n</div></div><div id=\"1475552833294-2eea77d5-3a43\" data-vc-content=\".vc_tta-panel-body\"><div><h4><a href=\"#1475552833294-2eea77d5-3a43\" data-vc-accordion=\"\" data-vc-container=\".vc_tta-container\"><span>How often should I change my wiper blades?</span><i/></a></h4></div><div>\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t<p>For vehicles that are parked inside, we recommend that the wiper blades be replaced at least once a year or when the wiper blades start streaking, whichever comes first. <p/></p>\\n<p>On vehicles kept outside or in areas where the wipers received excessive use, changing the blades twice a year is recommended for clearer vision. <p/></p>\\n\\n\\t\\t</div>\\n\\t</div>\\n</div></div><div id=\"1475552851166-fb528a14-876b\" data-vc-content=\".vc_tta-panel-body\"><div><h4><a href=\"#1475552851166-fb528a14-876b\" data-vc-accordion=\"\" data-vc-container=\".vc_tta-container\"><span>Do I need to take my car to the dealer for regular maintenance work in order to maintain my warranty?</span><i/></a></h4></div><div>\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t<p>No, you don&#8217;t. <p/></p>\\n<p>Provided you service the vehicle in accordance with any such requirements, the warranty will remain valid.<p/></p>\\n<p>Ensuring any servicing is carried out by qualified staff, according to the manufacturer&#8217;s specification, and that appropriate quality parts are used where required.<p/></p>\\n<p>However, it is important to keep a record of all maintenance work performed. <p/></p>\\n\\n\\t\\t</div>\\n\\t</div>\\n</div></div><div id=\"1475552869805-68d98250-d106\" data-vc-content=\".vc_tta-panel-body\"><div><h4><a href=\"#1475552869805-68d98250-d106\" data-vc-accordion=\"\" data-vc-container=\".vc_tta-container\"><span>When should I take my car to the dealer for work?</span><i/></a></h4></div><div>\\n\\t<div>\\n\\t\\t<div>\\n\\t\\t\\t<p>Warranty-covered repairs as well as recalls should be done at the dealer. <p/></p>\\n\\n\\t\\t</div>\\n\\t</div>\\n</div></div></div></div></div></div></div></div></div></div><div/></div><div><div><div><div><div><div><div>&#13;\\n\\t\\t\\t\\t\\t\\t<h4><i/>Team Members</h4>&#13;\\n\\t\\t\\t\\t\\t</div><div id=\"carousel-5896\">&#13;\\n\\t\\t\\t\\t\\t\\t<div><div>&#13;\\n\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t<img alt=\"Damon\" src=\"https://expresslube.com.au/wp-content/uploads/2016/10/damon-1.png\"/>&#13;\\n\\t\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t\\t<ul/>&#13;\\n\\t\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t\\t<h4>Damon</h4>&#13;\\n\\t\\t\\t\\t\\t\\t\\t<h5><b>CFO &#8211; Business Development Manager</b></h5>&#13;\\n\\t\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t\\t\\t<div>Co-founder&#160;and&#160;visionary behind the Express Lube concept for Australia. Highly skilled at budgeting, forecasting, business growth and profitability. Passionate about disruptive change, Damon is responsible for motivating the Express Lube team to achieve company goals and driving expansion.</div>&#13;\\n\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t</div></div>\\n<div><div>&#13;\\n\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t<img alt=\"Peter\" src=\"https://expresslube.com.au/wp-content/uploads/2016/10/peter.png\"/>&#13;\\n\\t\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t\\t<ul/>&#13;\\n\\t\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t\\t<h4>Peter</h4>&#13;\\n\\t\\t\\t\\t\\t\\t\\t<h5><b>COO and Managing Director</b></h5>&#13;\\n\\t\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t\\t\\t<div>Over 16 years&#8217; experience in the automotive trade, with awards for excellence in both industry knowledge and training. Peter manages the day to day operation of Express lube, developing company policy, procedures and culture to create a workplace that sets the benchmark for the vehicle service industry in innovation and compliance, while delivering industry leading levels of employee satisfaction.</div>&#13;\\n\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t</div></div>\\n<div><div>&#13;\\n\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t<img alt=\"Naithan\" src=\"https://expresslube.com.au/wp-content/uploads/2016/10/naithan.png\"/>&#13;\\n\\t\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t\\t<ul/>&#13;\\n\\t\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t\\t<h4>Naithan</h4>&#13;\\n\\t\\t\\t\\t\\t\\t\\t<h5><strong>Area Manager</strong></h5>&#13;\\n\\t\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t\\t\\t<div>Naithan has risen through the ranks at Express Lube, through dedication and attention to detail. He is responsible for employee training and provides support and guidance to staff and site managers. Driven by a desire to exceed expectations, Naithan takes pride in his ability to provide exceptional customer service and in leading small, diverse teams to achieve excellence.\\n<p/></div>&#13;\\n\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t</div></div>\\n<div><div>&#13;\\n\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t<img alt=\"Damian\" src=\"https://expresslube.com.au/wp-content/uploads/2016/10/damien-2.png\"/>&#13;\\n\\t\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t\\t<ul/>&#13;\\n\\t\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t<div>&#13;\\n\\t\\t\\t\\t\\t\\t\\t<h4>Damian</h4>&#13;\\n\\t\\t\\t\\t\\t\\t\\t<h5><strong>Co-Founder</strong></h5>&#13;\\n\\t\\t\\t\\t\\t\\t</div>&#13;\\n\\t\\t\\t\\t\\t\\t<div>Co-founder of Express Lube.&#160;27 years of international hospitality experience and an entrepreneurial edge. Has a passion and focus for delive