div/>\\n        </div>\\n\\n\\n            \\n            \\n            <div id=\"mk-shape-divider-9\">\\n\\t\\t\\t<div>\\n\\t\\t\\t\\t<div>\\n\\t\\t\\t\\t\\n\\t\\t<svg width=\"100%\" height=\"70px\"><defs><pattern id=\"shapeDividerPattern-9\" preserveaspectratio=\"none\" patternunits=\"userSpaceOnUse\" x=\"0\" y=\"0\" width=\"100%\" height=\"700px\" viewbox=\"0 0 100 700\"><polygon fill=\"#f3f4f4\" points=\"100,70 100,0 0,70 \"/></pattern></defs><rect x=\"0\" y=\"0\" width=\"100%\" height=\"70px\" fill=\"url(#shapeDividerPattern-9)\"/></svg>\\n</div>\\n\\t\\t\\t</div>\\n\\t\\t</div>\\n        \\n        <div/>\\n    </div>\\n</div>\\n\\n<div>\\n\\t<div>\\n\\t\\t<div>\\n\\n\\t\\t\\t\\n\\n\\n<div/>\\n\\t</div> \\t\\t</div> \\t\\t\\t</div> \\n\\n\\t\\t\\t\\t\\n<div>\\n    <div id=\"page-section-10\" data-intro-effect=\"false\">\\n\\n        \\n            \\n            <div>\\n                \\n\\n\\n<div/>\\n\\n                \\n                            </div>\\n            \\n            \\n        <div>\\n            <div>\\n<div>\\n\\t\\n\\n<div>\\n\\t\\t\\n\\t\\t<div><div><div>\\n<div id=\"text-block-11\">\\n\\n\\t\\n\\t<h1>If it\\'s your first home, or if it\\'s time to renovate, refinance or invest, the team at UME are here to help.<br/></h1>\\n\\n\\t<div/>\\n</div>\\n<div id=\"divider-12\">\\n\\n\\t\\t\\t<div/>\\n\\t\\n</div>\\n<div/>\\n\\n<div id=\"text-block-13\">\\n\\n\\t\\n\\t<div><div id=\"box-icon-14\"> <div> <i aria-hidden=\"true\"/> <div> <p>Nathan is a leading finance broker on the Central Coast of NSW. Established 14 years ago, Nathan and the team at UME are now the locally recognised broker of choice for residence and industry professions across the coast. UME helps 100\\'s of clients buy their first or dream home, invest in the property market or just review their current mortgage to help you pay off your home even faster. UME can also look after any assets finance and both general and personal insurance requirements.</p></div></div></div><d