7.035 15.695 15.695 15.695c6.499 0 11.787 5.281 11.787 11.771-.001 6.487-5.29 11.774-11.788 11.774z\"/></svg></i>\\n\\n    <div>\\n        <h4>\\n     Why should you use a mortgage broker?</h4>\\n\\n\\n<p>There are lots of good reasons why more than half of Australians now use a broker to secure a home loan. Probably the most important one that is we work for you, not the banks. We speak to you first to find out what you need, and then we use our knowledge of the market to better negotiate with the lenders. Then we get a range of options before we work out which one is right for you, not what&#8217;s right for the lenders.</p>\\n    </div>\\n\\n<div/>\\n</div>\\n\\n\\n\\n\\n\\n\\n    <div/>\\n</div>\\n\\n\\n\\n\\n<div id=\"divider-15\">\\n\\n\\t\\t\\t<div/>\\n\\t\\n</div>\\n<div/>\\n\\n<div id=\"box-icon-16\">\\n\\n    <div>\\n\\n    <i><svg data-name=\"mk-li-rocket\" data-cacheid=\"icon-5c3b037b28de8\" xmlns=\"http://www.w3.org/2000/svg\" viewbox=\"0 0 512 512\"><path d=\"M507.077 20.717c-.031-8.629-7.013-15.618-15.642-15.649h-2.376c-67.402 0-139.954 10.178-213.778 83.994l-46.902 46.902c-75.334 3.035-165.681 55.807-169.597 58.121-4.184 2.468-6.99 6.729-7.603 11.541-.605 4.813 1.042 9.641 4.475 13.074l103.706 103.706c-12.308-7.082-26.279-10.929-40.863-10.929-21.956 0-42.587 8.552-58.068 24.033-2.138 2.131-4.253 4.522-6.123 6.913-38.294 45.446-47.804 130.758-49.322 147.388-.421 4.644 1.241 9.227 4.537 12.522 2.959 2.959 6.951 4.599 11.097 4.599.475 0 .95-.031 1.433-.062 8.369-.766 82.829-8.353 131.946-39.176 8.483-4.062 16.086-9.427 22.607-15.941 26.808-26.823 31.092-67.67 13.029-99.076l103.812 103.828c2.951 2.943 6.951 4.583 11.097 4.583.367 0 .743 0 1.118-.031 4.537-.323 8.714-2.606 11.443-6.254 2.36-3.142 56.45-76.637 58.987-170.946l46.993-46.994c74.185-74.184 84.208-147.724 83.994-216.146zm-352.667 408.842c-4.146 4.138-9.058 7.541-14.584 10.101-.636.291-1.249.629-1.832 1.012-30.225 19.251-74.176 28.462-99.314 32.402 4.338-28.922 15.274-81.526 39.951-110.817 1.218