n-19)\"/></svg>\\n</div>\\n\\t\\t\\t</div>\\n\\t\\t</div>\\n            <div>\\n                \\n\\n\\n<div/>\\n\\n                \\n                            </div>\\n            \\n            \\n        <div>\\n            <div>\\n<div>\\n\\t<h1>Get started with our free guides.</h1><div id=\"divider-20\">\\n\\n\\t\\t\\t<div/>\\n\\t\\n</div>\\n<div/>\\n\\n\\n<div>\\n\\t\\t\\n\\t\\t<div><div><div><div id=\"mk-icon-box-21\">    <div><a href=\"/investing-in-property/\" target=\"_self\">        <img src=\"https://www.smartonline.com.au/wp-content/uploads/2014/06/investing-guide.png\" alt=\"Investing in property\"/></a>    </div><a href=\"/investing-in-property/\" target=\"_self\">    <h3>Investing in property</h3></a>    <p>Having the right people to help you is&#160;key when investing in property. Do your homework on the property market before you dive in, and we&#8217;ll be thrilled to help you when it comes to financing your decision.</p></div><div>\\n\\t<a href=\"/investing-in-property-guide/\" title=\"\">Download your free guide<br/>\\nto property investment</a></div>\\n</div></div></div><div><div><div><div id=\"mk-icon-box-22\">    <div><a href=\"/refinancing-your-home-loan/\" target=\"_self\">        <img src=\"https://www.smartonline.com.au/wp-content/uploads/2014/06/refinancing-guide.png\" alt=\"Refinancing your home loan\"/></a>    </div><a href=\"/refinancing-your-home-loan/\" target=\"_self\">    <h3>Refinancing your home loan</h3></a>    <p>As time marches on, situations change. Perhaps you&#8217;ve changed jobs? Or there&#8217;s a new addition to the family? Maybe you would just like a better rate or maybe you want to start that renovation&#160;project.</p></div><div>\\n\\t<a href=\"/looking-to-refinance-guide/\" title=\"\">Download your free guide<br/>\\nto home refinancing</a></div>\\n</div></div></div><div><div><div><div id=\"mk-icon-box-23\">    <div><a href=\"/becoming-a-first-home-buyer/\" target=\"_self\">        <img src=\"https://www.smartonline.com.au/wp-content/uploads/2014/06/first-home-buyers-guide.png\" alt=\"Becoming a first home buyer\"/></a>    </div><a href=\"/becoming-a-first-home-buyer/\" target=\"_self\">    <h3>Becoming a first home buyer</h3></a>    <p>Buying your first home is an exciting, but big step to take and one that comes with many questions and decisions. The two big questions are how much you can borrow and what are your likely repayments to&#160;be.</p></div><div>\\n\\t<a href=\"/first-home-buyers-guide/\" title=\"\"> Download your free guide<br/>\\nto buying your first home</a></div>\\n</div></div></div>\\t\\t\\n</div></div>\\n</div>\\n            <div/>\\n        </div>\\n\\n\\n            \\n            \\n            \\n        \\n        <div/>\\n    </div>\\n</div>\\n\\n<div>\\n\\t<div>\\n\\t\\t<div>\\n\\n\\t\\t\\t\\n\\n\\n<div/>\\n\\t</div> \\t\\t</div> \\t\\t\\t</div> \\n\\n\\t\\t\\t\\t\\n<div>\\n    <div id=\"page-section-24\" data-intro-effect=\"false\">\\n\\n        \\n            <div id=\"mk-shape-divider-25\">\\n\\t\\t\\t<div>\\n\\t\\t\\t\\t<div>\\n\\t\\t\\t\\t\\n\\t\\t<svg width=\"100%\" height=\"70px\"><defs><pattern id=\"shapeDividerPattern-25\" preserveaspectratio=\"none\" patternunits=\"userSpaceOnUse\" x=\"0\" y=\"0\" width=\"100%\" height=\"700px\" viewbox=\"0 0 100 700\"><polygon fill=\"#ffffff\" points=\"0,0 0,70 100,0 \"/></pattern></defs><rect x=\"0\" y=\"0\" width=\"100%\" height=\"70px\" fill=\"url(#shapeDividerPattern-25)\"/></svg>\\n</div>\\n\\t\\t\\t</div>\\n\\t\\t</div>\\n            <div>\\n                \\n\\n\\n<div/>\\n\\n                \\n                            </div>\\n            \\n            \\n        <div>\\n            <div>\\n<div>\\n\\t<h1>We work fast, and we work hard for our clients.</h1><div id=\"divider-26\">\\n\\n\\t\\t\\t<div/>\\n\\t\\n</div>\\n<div/>\\n\\n\\n<div>\\n\\t\\t\\n\\t\\t<div><div><div>\\n<div id=\"box-icon-27\">\\n\\n    <div>\\n\\n    <i><svg data-name=\"mk-li-portfolio\" data-cacheid=\"icon-5c3b037b3e8