ESHIPS</label> <input type=\"checkbox\" id=\"employment\" ng-model=\"job_search.employment\" value=\"0\" ng-checked=\"employment_checked\"/> <label for=\"employment\">EMPLOYMENT</label></div><div> <div><h2> Search</h2><button type=\"submit\" ng-click=\"methods.customSearch();\"/> </div></div><div> <div><h2> View All Available Jobs</h2><a href=\"/careers/all\"/> </div></div> </form></div><div id=\"informationBox\"> <a href=\"/careers\">Information for<br/>new apprentices and trainees </a></div><div id=\"informationBox\"> <a href=\"/employers\">Information for employers </a></div></div><div id=\"rightContent\"> <div ng-controller=\"careersController\"> <div ng-bind-html-unsafe=\"content\">{{content}} </div></div> <div><div> <a href=\"/i_need_space\"><div> <img src=\"_design/site/help.jpg\" width=\"100%\"/></div><div> <h3>I need space </h3> <p>From offices to commercial kitchens. </p></div> </a></div><div> <a href=\"/careers\"><div> <img src=\"_design/site/advice.jpg\" width=\"100%\"/></div><div> <h3>I need advice/info. </h3> <p>We have guides to help you. </p></div> </a></div><hr/> <div> <h2>150<span>+</span> </h2> <h3>Young People </h3> <p>employed each year </p> <h2>4000<span>+</span> </h2> <h3>Successful placements </h3></div><div> <p>Young career seekers can find great employment opportunities locally and employers can find candidates to perfectly suit their business by taking advantage of our group training program. </p></div> </div></div><div id=\"flexibleStudy\"> <h2>Flexible Study<span>+</span></h2> <h3>to support your on the job training.</h3> <p>Choose CCGT and we&#8217;ll make the most of getting you started in your new career. <a href=\"/benefits_of_being_an_apprentice_or_trainee_with_ccgt\">READ MORE</a></p></div> </div></div> </section> <footer> <div><div id=\"footerInner\"> <div id=\"quickLinksWrapper\"><h3>Quick Links</h3><hr/><div> <ul><li><a title=\"\" href=\"/job_alerts\">Register for Job Alerts</a></li><li><a title=\"\" href=\"/employers\">Register