ntent/uploads/2018/04/snoretest.png\"><img src=\"https://drlevissleepclinic.com.au/wp-content/uploads/2018/04/snoretest.png\" alt=\"sleep apnea test sydney\"/></a></div></div><div id=\"cmsmasters_divider_4b3p1kvmx\"/><div id=\"cmsmasters_button_40wu4og91i\"><a href=\"https://drlevissleepclinic.com.au/at-home-sleep-test/\"><span>BOOK A BULK BILLED HOME SLEEP TEST</span></a></div></div></div><div id=\"cmsmasters_column_jd9o1n0fq\"><div><div><div data-animation=\"bounceInUp\" data-delay=\"0\"><a href=\"https://drlevissleepclinic.com.au/wp-content/uploads/2018/04/sun.png\"><img src=\"https://drlevissleepclinic.com.au/wp-content/uploads/2018/04/sun.png\" alt=\"flaming sun\"/></a></div></div><div id=\"cmsmasters_heading_pdpjzm7cc\"><h2>DAYTIME SYMPTOMS</h2></div></div></div></div></div></div></div></div><div id=\"cmsmasters_row_terhe10pyv\"><div><div><div><div><div id=\"cmsmasters_column_d8nnby3h1\"><div><div id=\"cmsmasters_divider_2diaokl5\"/><div><div data-animation=\"slideInLeft\" data-delay=\"0\"><a href=\"https://drlevissleepclinic.com.au/wp-content/uploads/2018/04/bed5-1.png\"><img src=\"https://drlevissleepclinic.com.au/wp-content/uploads/2018/04/bed5-1.png\" alt=\"colorful bed\"/></a></div></div></div></div><div id=\"cmsmasters_column_n8v151u6bn\"><div><div id=\"cmsmasters_fb_mqhhwkk7ov\"><div><div><h2>Stop wasting your sleep<br/>\\n&#8211; why take a sleep test?</h2><p>Understanding your unique sleep patterns is key to finding a solution to snoring. To unlock this, Dr. Levi&#8217;s team takes your health history into consideration and gives you a revolutionary sleep test device.</p><p>It is designed to collect physiological data in the comfort of your home. You can sleep in your own bed wearing the device for one night while it tracks your breathing habits. It assesses lots of data including:</p><ul><li>How loudly you snore</li><li>Whether you sleep on your back or side</li><li>How much oxygen you are getting; and very importantly,</li><li>Whether you are experiencing SLEEP APNOEA<br/>\\n(stopping breathing whilst you are asleep)</li></ul><div id=\"cmsmasters_button_mc3n33icvn2\"><a href=\"https://drlevissleepclinic.com.au/at-home-sleep-test/\"><span>Learn More</span></a></div></div></div></div></div></div></div></div></div></div></div><div id=\"cmsmasters_row_l5zfiz5m9\" data-stellar-background-ratio=\"0.5\"><div><div><div><div><div id=\"cmsmasters_column_\"><div><div id=\"cmsmasters_fb_vowzcnaa8o\"><div><div><div><div id=\"cmsmasters_heading_vowzcnaa8o\"><h2>Meet Dr. Snore</h2></div><span>Dr. Snore has a wide range of snoring solutions to ensure you and your partner have a peaceful night sleep. Get started with a sleep test today.</span></div></div></div></div><div id=\"cmsmasters_button_lrn8erm2ul\"><a href=\"https://drlevissleepclinic.com.au/meet-dr-snore/#book\"><span>Book an appointment with Dr. Snore</span></a></div></div></div><div id=\"cmsmasters_column_\"><div><div><div data-animation=\"slideInRight\" data-delay=\"0\"><a href=\"https://drlevissleepclinic.com.au/wp-content/uploads/2018/04/nose.png\"><img src=\"https://drlevissleepclinic.com.au/wp-content/uploads/2018/04/nose.png\" alt=\"sleep clinic sydney\"/></a></div></div></div></div></div></div></div></div></div><div id=\"cmsmasters_row_m4ygsqretb\"><div><div><div><div><div id=\"cmsmasters_column_\"><div><div><h2>High tech solutions and good old-fashioned<br/>\\nscience solving your sleep problems.</h2></div></div></div></div></div><div><div><div id=\"cmsmasters_column_t3r53ngs34\"><div/></div><div id=\"cmsmasters_column_9p8tnk0n0d\"><div><div><p>Sleep is one of the most important things you do in your day and for many Australians, they are not getting the best sleep for their healths sake. Our sleep clinics offer a wide variety of solutions to your sleep problems including snoring, sleep apnoea, insomnia and a whole range of other problems. Come and meet our professional team and the range of solutions we tailor to your personal needs.</p></div></div></div><d