on_bottom&quot;:&quot;0&quot;,&quot;position_right&quot;:&quot;0&quot;,&quot;position_fixed&quot;:false,&quot;animation_type&quot;:&quot;fade&quot;,&quot;animation_speed&quot;:&quot;350&quot;,&quot;animation_origin&quot;:&quot;center top&quot;,&quot;overlay_zindex&quot;:false,&quot;zindex&quot;:&quot;1999999999&quot;},&quot;close&quot;:{&quot;text&quot;:&quot;&quot;,&quot;button_delay&quot;:&quot;0&quot;,&quot;overlay_click&quot;:false,&quot;esc_press&quot;:false,&quot;f4_press&quot;:false},&quot;click_open&quot;:[]}}\" role=\"dialog\" aria-hidden=\"true\" aria-labelledby=\"pum_popup_title_16794\"><div id=\"popmake-16794\"><div id=\"pum_popup_title_16794\">\\nDr. Dev Banerjee Biography</div><div><p><img src=\"https://drlevissleepclinic.com.au/wp-content/uploads/2018/08/111-300-150x150.png\" alt=\"\" width=\"150\" height=\"150\"/>Dr Dev Banerjee is an experienced Sleep Physician, and Medical Director at Dr. Levi&#8217;s Sleep Clinic. He also has an academic role in sleep research at the works at the Woolcock Institute of Medical Research (WIMR). He graduated in Medicine from the University of Leeds, UK with extensive training in Sleep Medicine in the UK and Australia. His training in Respiratory Medicine and Sleep Medicine took place in the West Midlands UK followed by a 14 months Clinical and Research Fellow appointment at the Woolcock Institute and Royal Prince Alfred Hospital Sydney 2003 and 2004. Between 2004 and 2013, he was a Senior Consultant Physician in Sleep Medicine at the Birmingham Heartlands Hospital, and Senior Research Fellow at Aston University between 2009 and 2013 and worked for University of Sydney and St. Vincent&#8217;s Hospital (Darlinghurst, Sydney). Other roles include providing sleep advice regularly on TV and Radio and Newspapers, and assisting Court as a medicolegal expert in the field of Sleep Medicine.</p></div><button type=\"button\" aria-label=\"Close\">\\nCLOSE            </button></div></div><div id=\"pum-16788\" data-popmake=\"{&quo