0 years&#8217; experience as a Dentist and over 20 years&#8217; in sleep medicine. He is a member of the Australasian Sleep Association, American Academy of Dental Sleep Medicine and European Academy of Dental Sleep Medicine.</p><p>As a former sufferer of Sleep Apnoea, Dr. Levi understands the problem from all perspectives and has the technical expertise to provide the best-customized solutions. Through the Sleep Clinic, Dr. Levi identifies the correct pathway to direct patients to the appropriate solution to fit their individual needs.</p><p>Dr. Levi treats sleep apnoea, snoring and other sleep disorders. Sleep problems can cause fatigue, tiredness, breathing problems and other health complications. When we sleep &#8211; different bodily functions slow down and this change in levels can cause problems for some people.</p><p>The clinic conducts a non-invasive,&#160;<strong>bulk billing take-home test</strong>&#160;that collects sleep data during one night of sleep. The data is sent via the machine to professionals and Dr.&#160;Levi&#160;then provides a&#160;thorough clinical assessment, clear recommendations and diagnosis. Treatment is through&#160;customised solutions depending on the patient&#8217;s habits, sleeping problems, and health implications.</p><p>Dr. Levi is working with the Sleep Health Foundation to promote the importance of getting plenty of shut-eye. Also lectures widely and is asleep health commentator on television and radio.</p></div><button type=\"button\" aria-label=\"Close\">\\nCLOSE            </button></div></div><div id=\"pum-16601\" data-popmake=\"{&quot;id&quot;:16601,&quot;slug&quot;:&quot;mas&quot;,&quot;theme_id&quot;:16354,&quot;cookies&quot;:[],&quot;triggers&quot;:[{&quot;type&quot;:&quot;click_open&quot;,&quot;settings&quot;:{&quot;extra_selectors&quot;:&quot;.mas-vid&quot;}}],&quot;mobile_disabled&quot;:null,&quot;tablet_disabled&quot;:null,&quot;meta&quot;:{&quot;display&quot;:{&quot;stackable&quot;:false,&quot;overlay_disabled&qu