fast IRS and have to say I didn&#8217;t know how things would work out if I ever needed to make a claim. I now have the upmost confidence moving forward.\"&#13;\\n</p><h4>Ballard Automotive Group</h4>&#13;\\nMichael Ballard<p/></div></div></div></li><li id=\"testimonials-c-950\"><div><div><img src=\"\"/></div><div><div><p>\" Good news, my claim has settled and the funds are in my account today.&#13;\\nI\\'m very appreciative of what Kerrie Betts, Diane Martin and the claims team have done to expedite this.&#13;\\nSteadfast IRS are very fortunate to have such an efficient claims team and I&#13;\\ncan\\'t praise you enough for your hard work on my behalf.\"&#13;\\n</p><h4>Personal Insurance client</h4>&#13;\\nGeoff Simmons<p/></div></div></div></li><li id=\"testimonials-c-78\"><div><div><img src=\"http://steadfast-irs.com.au/wp-content/uploads/2016/09/eastwestlogo-150x105.png\"/></div><div><div><p>I just want to take 5 minutes to take special mention to your team who have been an amazing help through all of my proceedings and has probably helped me stay calm through this long and exhausting claims process. This team and service is an absolute credit to your company&#13;\\n</p><h4>East West Building PTY</h4>&#13;\\nWilliam Wise, Owner<p/></div></div></div></li><li id=\"testimonials-c-76\"><div><div><img src=\"http://steadfast-irs.com.au/wp-content/uploads/2016/09/byronlogo-150x90.png\"/></div><div><div><p>&#8220;Thank you for your great effort. You are worthy of an Oscar! I was thinking that we have lost the case, but when we put faith and hope together in you, we know you will excel and you did! Job well done!&#8221;&#13;\\n&#8220;Thank you for your great effort. You are worthy of an Oscar! I was thinking that we have lost the case, but when we put faith and hope together in you, we know you will excel and you did! Job well done!&#8221;&#13;\\n</p><h4>Tat Som Kok</h4>&#13;\\nThe Byron at Byron<p/></div></div></div></li></ul></div></div><div><div><div><div><div><div>\\