e=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><div itemprop=\"text\"><h2>Property Inspections You Can Trust</h2>\\n</div></section>\\n<section itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><div itemprop=\"text\"><p>Diamond Property Inspections are Australia&#8217;s leading Property Report service. With over 30 years experience and 300,000 reports, we have the expertise you can trust when purchasing your most significant asset.</p>\\n</div></section></div>\\n\\n</div></div></div></div></div><div id=\"av_section_2\"><div><div><div><div>\\n<div/><div><section itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><div itemprop=\"text\"><p align=\"justify\">Our commitment is to provide you with unparalleled peace of mind, taking care of all the finer details you need to consider for your property.</p>\\n</div></section></div><div/><div><span><span/></span></div>\\n<div itemscope=\"itemscope\" itemtype=\"https://schema.org/ImageObject\"><div><img src=\"https://diamondnet.com.au/wp-content/uploads/2013/04/divider_white.png\" alt=\"\" title=\"divider_white\" itemprop=\"thumbnailUrl\"/></div></div>\\n<div><article itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><div><header><div aria-hidden=\"true\" data-av_icon=\"&#59469;\" data-av_iconfont=\"entypo-fontello\"/><h3 itemprop=\"headline\">Complete</h3></header><div itemprop=\"text\"><p><span>We offer an independent service of high quality, trustworthy inspections from a range of top quality pre-purchase inspection providers</span></p>\\n</div></div><footer/></article></div><div><article itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><div><header><div aria-hidden=\"true\" data-av_icon=\"&#59410;\" data-av_iconfont=\"entypo-fontello\"/><h3 itemprop=\"headline\">Trustworthy</h3></header><div itemprop=\"text\"><p><span>Our inspectors are fully insured, accredited, licensed and experienced for your peace of mind.</span></p>\\n</div></div><footer/></article></div><div><article itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><div><header><div aria-hidden=\"true\" data-av_icon=\"&#59490;\" data-av_iconfont=\"entypo-fontello\"/><h3 itemprop=\"headline\">Efficient</h3></header><div itemprop=\"text\"><p><span>We arrange most inspections within 24 hours along with a verbal report on the day of inspection</span></p>\\n</div></div><footer/></article></div><div><span><span/></span></div>\\n\\n</div></div></div></div></div><div id=\"av_section_3\"><div><div><div><div>\\n<div><section itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><div itemprop=\"text\"><h2>We Specialise in All Types of Property Inspections</h2>\\n</div></section>\\n<section itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><div itemprop=\"text\"><p align=\"justify\">Detailed, easy to understand Pre-Purchase reports can be arranged for:</p>\\n</div></section></div><div><div><div><a href=\"https://diamondnet.com.au/building-and-pest/\"><span>Building</span></a></div></div><div/><div><div><a href=\"https://diamondnet.com.au/pest/\"><span>Timber Pest</span></a></div></div><div/><div><div><a href=\"https://diamondnet.com.au/pool/\"><span>Pool</span></a></div></div></div><div><div><div><a href=\"https://diamondnet.com.au/propertysafe/\"><span>PropertySafe</span></a></div></div><div/><div><div><a href=\"https://diamondnet.com.au/strata/\"><span>Strata</span></a></div></div><div/><div><div><a href=\"https://diamondnet.com.au/building-completion-report/\"><span>Building Completion</span></a></div></div></div><div><div><div><a href=\"https://diamondnet.com.au/building-and-pest/\"><span>Identification Survey</span></a></div></div><div/><div><div><a href=\"https://diamondnet.com.au/engineers-report/\"><span>Engineers</span></a></div></div><div/><div><div><a href=\"https://diamondnet.com.au/boundary-peg-out/\"><span>Boundary Peg Out</span></a></div></div></div><div><div><div><a href=\"https://diamondnet.com.au/plumbing-report/\"><span>Plumbing</span></a></div></div><div/><div><div><a href=\"https://diamondnet.com.au/valuation/\"><span>Valuation</span></a></div></div><div/><div><div><a href=\"https://diamondnet.com.au/tax-depreciation-report/\"><span>Tax Depreciation</span></a></div></div></div></div></div></div></div></div><div id=\"av_section_4\"><div><div><div><div>\\n<div/><div><div><h3 itemprop=\"headline\">Your Satisfaction Guaranteed.</h3><div><div/></div></div>\\n<section itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><div itemprop=\"text\"><p>We have stringent standards at Diamond and&#160;are confident in the quality of service we provide.<br/>\\nWe guarantee you&#8217;ll be satisfied with our service.</p>\\n<p>Protect your investment and order a Diamond property inspection today.</p>\\n</div></section>\\n<div><a href=\"https://diamondnet.com.au/order/\"><span aria-hidden=\"true\" data-av_icon=\"&#59509;\" data-av_iconfont=\"entypo-fontello\"/><span>Order Property Inspection</span></a></div></div><div><div itemscope=\"itemscope\" itemtype=\"https://schema.org/ImageObject\"><div><img src=\"https://diamondnet.com.au/wp-content/uploads/2013/04/guarantee-1.png\" alt=\"\" title=\"guarantee\" itemprop=\"thumbnailUrl\"/></div></div></div>\\n\\n</div></div></div></div></div><div id=\"av_section_5\" data-section-bg-repeat=\"no-repeat\"><div><div/><div><div><div><div>\\n<div><div><h3 itemprop=\"headline\">Be smart. Be safe.</h3><div><div/></div></div>\\n<section itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><div itemprop=\"text\"><p>Before you purchase any property, order a property inspection from us and save yourself from any unwanted surprises.</p>\\n</div></section></div><div><div><a href=\"https://diamondnet.com.au/quote/\"><span aria-hidden=\"true\" data-av_icon=\"&#59469;\" data-av_iconfont=\"entypo-fontello\"/><span>Get a Free Quote</span></a></div>\\n<div><a href=\"https://diamondnet.com.au/sample-reports/\"><span aria-hidden=\"true\" data-av_icon=\"&#59467;\" data-av_iconfont=\"entypo-fontello\"/><span>View Sample Reports</span></a></div></div>\\n\\n</div></div></div></div></div></div><div id=\"av_section_6\"><div><div><div><div>\\n<section itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><div itemprop=\"text\"><h2>What Our Customers Say</h2>\\n</div></section>\\n<div data-autoplay=\"1\" data-interval=\"5\" data-animation=\"fade\" data-hoverpause=\"1\">\\n<section><div itemscope=\"itemscope\" itemtype=\"https://schema.org/Person\"><div><div itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><p><em>&#8220;Thank you for the quick turnaround on this and the professionalism shown through the whole process.&#8221;</em></p>\\n</div><div><div><div/></div><div><strong itemprop=\"name\">Rae D</strong></div></div></div></div>\\n<div itemscope=\"itemscope\" itemtype=\"https://schema.org/Person\"><div><div itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><p><em>&#8220;Thank you!</em><br/>\\n<em> What a great service, and special thanks to Christine for going out of her way pre-Easter to make sure we had all the necessary authorities etc to allow the search to proceed!!&#8221;</em></p>\\n</div><div><div><div/></div><div><strong itemprop=\"name\">Ian W</strong></div></div></div></div>\\n<div itemscope=\"itemscope\" itemtype=\"https://schema.org/Person\"><div><div itemscope=\"itemscope\" itemtype=\"https://schema.org/CreativeWork\"><p><em>&#8220;We have been using the Services for several years and have always found the service they provide to be prompt and reliable. We have also found the inspectors that prepare the reports to be very approachable and happy to talk about issues raised in the reports.&#8221;</em></p>\\n</div><div><div><div/></div><div><strong itemprop=\"name\">Richard L</strong></div></div></div></div>\\n<div itemscope=\"itemscope\" itemtype=\"https://schema.org/Person\"><div><div itemscope=\"itemscope\