esheet'\"> <link rel=\"icon\" href=\"https://www.trunorth.com.au/wp-content/uploads/2018/11/trunorth-menu-logo-150x150.png\" sizes=\"32x32\"> <link rel=\"icon\" href=\"https://www.trunorth.com.au/wp-content/uploads/2018/11/trunorth-menu-logo-300x300.png\" sizes=\"192x192\"> <link rel=\"apple-touch-icon-precomposed\" href=\"https://www.trunorth.com.au/wp-content/uploads/2018/11/trunorth-menu-logo-300x300.png\"> <meta name=\"msapplication-TileImage\" content=\"https://www.trunorth.com.au/wp-content/uploads/2018/11/trunorth-menu-logo-300x300.png\"> </head> <body> <div> <header> <div> <div> <span> </span> <a href=\"https://www.trunorth.com.au/\"> </a> </div> <div> <nav> <ul> <li> <a href=\"http://trunorth.com.au/contact-us/\">Request a quote </a> </li> <li> <a href=\"tel:+0410630315\">Phone 0414 630 315 </a> </li> <li> <a href=\"https://www.instagram.com/trunorth.landscapes/\"> <i aria-hidden=\"true\"> </i> </a> </li> <li> <a href=\"https://www.facebook.com/trunorthlandscapes/\"> <i aria-hidden=\"true\"> </i> </a> </li> </ul> </nav> <div> <div> <span>Select Page </span> <span> </span> </div> </div> </div> </div> <div> <div> <form role=\"search\" method=\"get\" action=\"https://www.trunorth.com.au/\"> <input type=\"search\" placeholder=\"Search \u2026\" value=\"\" name=\"s\" title=\"Search for:\"> </form> <span> </span> </div> </div> </header> <div> <div> <article> <div> <div> <div> <div> <div> <div> <div> <div> <h2>We will help you find your TruNorth Landscape. </h2> <h6> <a href=\"https://www.trunorth.com.au/recent-projects/\">When will you find yours\u2026 </a> </h6> </div> </div> </div> <div> </div> </div> </div> <div> <div> <div> <div> <div> <h2>We help you find your TruNorth Landscape. </h2> <h6> <a href=\"https://www.trunorth.com.au/recent-projects/\">When will you find yours\u2026 </a> </h6> </div> </div> </div> </div> </div> <div> <div> <div> <nav> <ul> <li> <a href=\"https://www.trunorth.com.au/what-we-do/\">WHAT WE DO </a> </li> <li> <a href=\"https://www.trunorth.com.au/who-we-work-with/\">WHO WE WORK WITH </a> </li> <li> <a href=\"https://www.trunorth.com.au/our-process/\">OUR PROCESS </a> </li> <li> <a href=\"https://www.trunorth.com.au/why-us/\">WHY CHOOSE US </a> </li> <li> <a href=\"https://www.trunorth.com.au/recent-projects/\">RECENT PROJECTS </a> </li> </ul> </nav> <div> <a href=\"#\"> <span> </span> </a> </div> </div> </div> </div> <div> <div> <div> <div> <div> <h1>TruNorth <span>Landscapes </span>is a Central <g>Coast based </g> landscape design and construction company. </h1> </div> </div> <div> <div> </div> </div> </div> <div> <div> <div> <h2>Let us help you find your <span>TruNorth </span> Landscape. </h2> </div> </div> <div> <div> <p>We know everyone is unique and we all need different things from a landscape solution to suit our lifestyles. It is about combining what we like visually with the practicality and function of how we live. We call this your \u2018TruNorth\u2019 and when we help you find it you will continue to enjoy your landscaped space for years to come. </p> <p>No matter how big or how small your landscaping construction needs, from home gardens, rural acreages, balcony gardens, childcare <g>centre </g> playgrounds or business premises, TruNorth Landscapes provide the complete end-to-end solution for your landscape requirements. TruNorth Landscapes will create the right balance between the function you require with the look and style you desire for your landscape project, and all within budget. We are your Central <g>Coast based </g> Landscape Design and Construction company. </p> </div> </div> <div> <div> <h6> <a href=\"/trunorthlandscapes/recent-projects\">Click here to view our recent projects </a> </h6> </div> </div> </div> </div> </div> <div> <div> <div> <div> <div> <h3>What we do </h3> </div> </div> <div> <div> <h2>TruNorth Landscapes have the team with the skills, experience and equipment to deliver you the right landscape solution. </h2> </div> </div> <div> <div> <p>From creating rural acreage gardens to constructing childcare centre playgrounds, TruNorth Landscapes have the team with the skills, experience and equipment to deliver the complete end-to-end landscape solution for you. </p> <p>With a carefully considered approach selecting the right combination of paving, retaining, decking and planting \u2013 our landscapes will deliver the desired result you are looking for. </p> </div> </div> <div> <div> <h6> <a href=\"http://trunorth.com.au/what-we-do/\">Learn more </a> </h6> </div> </div> </div> <div> <div> <span> </span> </div> </div> </div> </div> <div> <div> <div> <div> <div> <h2>Some of our recent <span>projects </span> </h2> </div> </div> </div> </div> <div> <div> <div> <div> <div> <div> <a href=\"http://trunorth.com.au/project/horsfield-bay-residential/\"> <div> <h2>Horsfield Bay <span> </span> </h2> <p> </p> </div> </a> </div> </div> </div> </div> </div> <div> <div> <div> <div> <div> <a href=\"http://trunorth.com.au/project/ourimbah-acreage-residential/\"> <div> <h2>Ourimbah <span> </span> </h2> <p> </p> </div> </a> </div> </div> </div> </div> </div> <div> <div> <div> <div> <div> <a href=\"http://trunorth.com.au/project/bateau-bay-residential/\"> <div> <h2>Bateau Bay <span> </span> </h2> <p> </p> </div> </a> </div> </div> </div> </div> </div> </div> <div> <div> <div> <div> <div> <div> <a href=\"http://trunorth.com.au/project/terrigal-residential/\"> <div> <h2>Terrigal <span> </span> </h2> <p> </p> </div> </a> </div> </div> </div> </div> </div> <div> <div> <div> <div> <div> <a href=\"http://trunorth.com.au/project/tuggerah-childcare-centre/\"> <div> <h2>Tuggerah <span> </span> </h2> <p> </p> </div> </a> </div> </div> </div> </div> </div> <div> <div> <div> <div> <div> <a href=\"http://trunorth.com.au/project/ourimbah-woods-residential/\"> <div> <h2>Ourimbah <span> </span> </h2> <p> </p> </div> </a> </div> </div> </div> </div> </div> </div> <div> <div> <div> <a href=\"https://www.trunorth.com.au/recent-projects/\">VIEW ALL PROJECTS </a> </div> </div> </div> </div> <div> <div> <div> <div> <div> <h3>Our Process. </h3> </div> </div> <div> <div> </div> </div> </div> </div> <div> <div> <div> <div> <div> <h4>Discovering your TruNorth </h4> <div> <p>Our team has years of experience and know how to find the solution to combine your needs and desires to form your TruNorth Landscape. </p> </div> </div> </div> </div> </div> <div> <div> <div> <div> <h4>Working with your budget </h4> <div> <p>As with any investment it is important to understand your budget going in. Although budgets may vary it should not mean that you should compromise on the result you want to achieve. </p> </div> </div> </div> </div> </div> <div> <div> <div> <div> <h4>Designing for you </h4> <div> <p>Understanding your aspirations and budget allows us to mould materials, labour and design to create a landscape solution that meets your specific needs. </p> </div> </div> </div> </div> </div> </div> <div> <div> <div> <div> <div> <h4>Working to schedules </h4> <div> <p>Although weather can play a big part in a project running to schedule, TruNorth will set work completion milestones to keep everyone on track and provide clarity to timeline expectations. </p> </div> </div> </div> </div> </div> <div> <div> <div> <div> <h4>Commencing landscape work </h4> <div> <p>TruNorth team have a keen eye for detail with everything we do, and we know the finish is everything. We ensure all landscape components combine beautifully with each other and the environment to form a beautiful and functional finished result. </p> </div> </div> </div> </div> </div> <div> <div> <div> <div> <h4>Satisfaction guaranteed </h4> <div> <p>Once the landscaping work has been completed, we ensure we provide a thorough clean-up and a final walk through to ensure you are 100% happy with the result. </p> </div> </div> </div> </div> </div> </div> <div> <div> <div> <a href=\"https://www.trunorth.com.au/our-process/\">READ MORE </a> </div> </div> </div> </div> <div> <div> </div> <div> <div> <div> <div> <h2>A Central Coast based landscape design and construction company. </h2> </div> </div> <div> <div> </div> </div> <div> <div> <h4>We are a team of landscape builders, garden designers, horticulturalists and nature enthusiasts who simply love what we do. </h4> </div> </div> <div> <div> <p>The TruNorth Landscape team brings a specialists skill set to every landscape we create. Our passion for our chosen fields of expertise is unrivalled. Although, our team as individuals are as unique as the landscapes we create, together we form a business that simply deliver exceptional results, combining the right mix of experience, passion and hard-work. </p> <p> <strong>Our mission is simple \u2013 to exceed our customers\u2019 expectations on every project we undertake. </strong> </p> </div> </div> <div> <a href=\"https://www.trunorth.com.au/why-us/\">READ MORE </a> </div> </div> </div> </div> <div> <div> <div> <div> <div> <h3>Our story begins and ends with our customers... </h3> </div> </div> </div> </div> <div> <div> <div> <div> </div> <div> <div> <h4>Vision and Advice </h4> <p>TruNorth did an absolutely wonderful job at our place. Will\u2019s vision and advice helped to create an elegant entry to both our home and pool area. In just three weeks the extensive stonework was complete. To see the work they achieved each day was just so exciting and his team were a delight to have around. We get so much pleasure from the sandstone path that sometimes we even have our coffee on it! Now - what can we get them to work on next... </p> <span>Ian and Jennifer </span> <p> <span>Ourimbah </span> </p> </div> </div> </div> <div> <div> </div> </div> <div> <div> </div> <div> <div> <h4>Making it happen </h4> <p>We would highly recommend TruNorth Landscapes to anyone who is looking for a team of people who can address all aspects of landscaping. They are delightful people who listen to your needs and make it all happen, within budget and with a flexible can-do attitude \u2013 always nice to have someone who cares. </p> <p> </p> <span>Peter and Maggie </span> <p> <span>Mannering Park </span> </p> </div> </div> </div> </div> <div> <div> <div> </div> <div> <div> <h4>Delightful Garden </h4> <p>William and his team built it quickly, efficiently and within budget. William consulted with us every step of the way during the project and watching the creation was very exciting. We commute to Sydney like many Central Coast families and when we wake up on weekends and sip coffee in our delightful garden there is no where else we could imagine being! Thanks TruNorth </p> <span>Alison and Tony O\u2019Neill </span> <p> <span>Kariong </span> </p> </div> </div> </div> <div> <div> </div> </div> <div> <div> </div> <div> <div> <h4>Considered beauty </h4> <p>We would like to express our gratitude and appreciation for the time, consideration and effort that went into creating our beautiful garden. The team was unfailingly cheerful, considerate, polite, helpful and punctual. </p> <p> </p> <span>Jennie and Geoff </span> <p> <span>Terrigal </span> </p> </div> </div> </div> </div> </div> </div> <div> <div> <div> <div> <div> <h2>Find your TruNorth Landscape. </h2> </div> </div> <div> <div> </div> </div> <div> <div> <h4>From the moment you meet with TruNorth Landscapes, so begins your experience. Fill in your <g>enquiry </g> below or give us a call on (02) 4362 2342 to get started. </h4> </div> </div> </div> </div> <div> <div> <div> <div> </div> <div> <form method=\"post\" action=\"https://www.trunorth.com.au/\"> <p> <label for=\"et_pb_contact_name_0\">Name </label> <input type=\"text\" value=\"\" name=\"et_pb_contact_name_0\" placeholder=\"Name\"> </p> <p> <label for=\"et_pb_contact_email_0\">Email Address </label> <input type=\"text\" value=\"\" name=\"et_pb_contact_email_0\" placeholder=\"Email Address\"> </p> <p> <label for=\"et_pb_contact_suburb_0\">Suburb </label> <input type=\"text\" value=\"\" name=\"et_pb_contact_suburb_0\" placeholder=\"Suburb\"> </p> <p> <label for=\"et_pb_contact_phone_0\">Phone </label> <input type=\"text\" value=\"\" name=\"et_pb_contact_phone_0\" placeholder=\"Phone\"> </p> <p> <label for=\"et_pb_contact_message_0\">Message </label> <textarea name=\"et_pb_contact_message_0\" placeholder=\"Message\"> </textarea> </p> <input type=\"hidden\" value=\"et_contact_proccess\" name=\"et_pb_contactform_submit_0\"> <input type=\"text\" value=\"\" name=\"et_pb_contactform_validate_0\"> <div> <div> <p> <span>1 + 5 </span> = <input type=\"text\" size=\"2\" value=\"\" name=\"et_pb_contact_captcha_0\"> </p> </div> <button type=\"submit\">Send </button> </div> <input type=\"hidden\" name=\"_wpnonce-et-pb-contact-form-submitted-0\" value=\"a7efe722bf\"> <input type=\"hidden\" name=\"_wp_http_referer\" value=\"/\"> </form> </div> </div> </div> </div> </div> </div> </div> </div> </article> </div> <footer> <div> <div> <div> <div> </div> </div> <div> <div> <div> <h4>TruNorth Landscapes </h4> <p>Ourimbah <br> Lic Number: 175393C </p> <p> <strong>Phone: </strong> 4362 2342 <br> <a href=\"mailto:info@trunorth.com.au\">info@trunorth.com.au </a> </p> </div> </div> <div> <h4>Follow us on\u2026 </h4> <div> <p> <a href=\"https://www.facebook.com/TruNorth.Landscapes/\" target=\"_blank\" rel=\"noopener noreferrer\">Facebook </a> <br> <a href=\"https://www.instagram.com/trunorth.landscapes/\" target=\"_blank\" rel=\"noopener noreferrer\">Instagram </a> </p> </div> </div> </div> <div> <div> <div> <h4>Quick Links </h4> <h6> <a href=\"http://trunorth.com.au/why-us/\">About TruNorth </a> </h6> <h6> <a href=\"http://trunorth.com.au/recent-projects/\">Landscape Projects </a> </h6> <h6> <a href=\"http://trunorth.com.au/our-process/\">Working with us </a> </h6> <h6> <a href=\"http://trunorth.com.au/contact-us/\">Contact Us </a> </h6> </div> </div> </div> <div> <div> <div> <h4>Accreditation </h4> <p>Member of the Landscape Contractors Association Fully insured and licensed. </p> </div> </div> <div> <a href=\"http://www.landscapenswact.co